# This is a sample config file. It was tested with:
#
#      Compiler name/version:       [gcc, 4.2 snapshot 20060325]
#      Compiler name/version:       [gcc, 4.2 snapshot 20060617]
#      Operating system version:    [SLES9 SP3 for AMD64]
#      Operating system version:    [SUSE 10.1 for AMD64]
#      Hardware:                    [Opteron]
#
# If your platform uses different versions, different
# hardware or operates in a different mode (for
# example, 32- vs. 64-bit mode), there is the possibiliy
# that this configuration file may not work as-is.
#
# Note that issues with compilation should be directed
# to the compiler vendor. Information about SPEC techncial
# support can be found in the techsupport document in the
# Docs directory of your benchmark installation.
#
# Also note that this is a sample configuration. It
# is expected to work for the environment in which
# it was tested; it is not guaranteed that this is
# the config file that will provide the best performance.
#
# Note that you might find a more recent config file for
# your platform with the posted results at
# www.spec.org/cpu2006
####################################################################
# linux64-amd64-gcc42.cfg
# FSF's gcc 4.2 config file for
# AMD64 64-bit (64 bit binaries on 64 bit host)
# Config file for CPU2006	int and fp Base only
#####################################################################

ignore_errors = yes
tune          = base
ext           = aarch64_linux
output_format = asc, pdf, Screen
reportable    = 0
teeout        = yes
teerunout     = yes
hw_avail = Dec-9999
license_num = 9999
test_sponsor = Turbo Computers
prepared_by = 
tester      =
test_date = Dec-9999
strict_rundir_verify = 0

default=default=default=default:
#####################################################################
#
# Compiler selection
#
#####################################################################
CC           = gcc
CXX          = g++
FC           = gfortran

## HW config
hw_model     = Tyan Thunder KKQS Pro (S4882)
hw_cpu_name  = AMCC X-gene
hw_cpu_char  =
hw_cpu_mhz   = 1500
hw_fpu       = Integrated
hw_nchips	= 1
hw_ncores	= 8
hw_ncoresperchip= 8
hw_nthreadspercore = 1
hw_ncpuorder = 1 chip
hw_pcache    = 32 KB I + 32 KB D on chip per chip
hw_scache    = 3 MB I+D on chip per chip
hw_tcache    = None
hw_ocache    = None
hw_memory	= 8 GB (1 x 8GB DDR333 CL2.5)
hw_disk		= SATA
hw_vendor	= Tyan

## SW config
sw_os        = SUSE SLES9 (for AMD64)
sw_file      = ext3
sw_state     = runlevel 3
sw_compiler  = gcc , g++ & gfortran 4.2.0325 (for AMD64)
sw_avail = Dec-9999
sw_other = None
sw_auto_parallel = No
sw_base_ptrsize = 64-bit
sw_peak_ptrsize = Not Applicable

#####################################################################
# Optimization
#####################################################################
## Base is low opt
default=base=default=default:
COPTIMIZE     = -std=gnu89 -flto -O3 -march=armv8-a -ffast-math -funroll-loops -fomit-frame-pointer -fprefetch-loop-arrays
CXXOPTIMIZE  = -std=c++03 -flto -O3 -march=armv8-a -ffast-math -funroll-loops  -fomit-frame-pointer -fprefetch-loop-arrays
FOPTIMIZE  = -O3 -march=armv8-a -ffast-math -funroll-loops  -fomit-frame-pointer -fprefetch-loop-arrays

notes0100= C base flags: $[COPTIMIZE]
notes0110= C++ base flags: $[CXXOPTIMIZE]
notes0120= Fortran base flags: $[FOPTIMIZE]

400.perlbench=base=default=default:
COPTIMIZE     = -std=gnu89 -O3 -march=armv8-a -ffast-math -funroll-loops -fomit-frame-pointer

416.gamess=default=default=default:
FOPTIMIZE  = -O3 -march=armv8-a -ffast-math -funroll-loops  -fomit-frame-pointer -fprefetch-loop-arrays -fno-tree-dominator-opts -fno-aggressive-loop-optimizations -fwhole-program -flto=jobserver -fuse-linker-plugin

429.mcf=default=default=default:
COPTIMIZE     = -O3 -march=armv8-a -ffast-math -funroll-loops -fomit-frame-pointer

470.lbm=default=default=default:
COPTIMIZE     = -O3 -march=armv8-a -ffast-math -funroll-loops -fomit-frame-pointer

483.xalancbmk=default=default=default:
CXXOPTIMIZE     = -std=c++03 -flto -O3 -march=armv8-a -ffast-math -funroll-loops  -fomit-frame-pointer

#####################################################################
# 32/64 bit Portability Flags - all
#####################################################################

default=base=default=default:
notes25= PORTABILITY=-DSPEC_CPU_LP64 is applied to all benchmarks in base.
PORTABILITY = -DSPEC_CPU_LP64

#####################################################################
# Portability Flags - INT
#####################################################################

400.perlbench=default=default=default:
notes35    = 400.perlbench: -DSPEC_CPU_LINUX_X64
CPORTABILITY= -DSPEC_CPU_LINUX_X64 -include math.h
EXTRA_CFLAGS = -fno-strict-aliasing

416.gamess=default=default=default:
FPORTABILITY = -std=legacy -fno-aggressive-loop-optimizations   -fdelete-dead-exceptions 

434.zeusmp=default=default=default:
FPORTABILITY= -fno-second-underscore 

436.cactusADM=default=default=default:
FPORTABILITY= -fno-second-underscore 

437.leslie3d=default=default=default:
FPORTABILITY= -fno-second-underscore 
    
447.dealII=default:
CXXPORTABILITY= -fpermissive -include cstdlib -include cstring -include stddef.h
                            
454.calculix=default=default=default:
FPORTABILITY= -fno-second-underscore 
EXTRA_OPTIMIZE   = --param max-completely-peeled-insns=4000

462.libquantum=default=default=default:
notes60= 462.libquantum: -DSPEC_CPU_LINUX
CPORTABILITY= -DSPEC_CPU_LINUX

464.h264ref=default=default=default:
CPORTABILITY = -fsigned-char

482.sphinx3=base=aarch64_linux=default:
CPORTABILITY = -fsigned-char

483.xalancbmk=default=default=default:
#CXXPORTABILITY= -DSPEC_CPU_LINUX -DXALAN_STRICT_ANSI_HEADERS
CXXPORTABILITY= -DSPEC_CPU_LINUX -include cstdlib -include cstring -include stddef.h

#####################################################################
# Portability Flags - FP
#####################################################################
481.wrf=default=default=default:
#wrf_data_header_size = 8
CPORTABILITY = -DSPEC_CPU_CASE_FLAG -DSPEC_CPU_LINUX
